import React , {Component} from 'react';


class Contactitem extends Component{

    render(){
        return(
            <tr>
                <th scope="row">1</th>
                <td>Mark</td>
                <td>Otto</td>
                <td>
                    <span style={{cursor:''}} className="badge badge-danger font-weight-bold p-2">
                        &times;
                    </span>
                </td>
            </tr>
        )
    }
}

export default Contactitem;
